import React from 'react';
import './MuscleMap.css'; // Assure-toi d'avoir ce fichier pour les styles

const MuscleMapFull = ({ onSelect }) => {
  const handleClick = (muscle) => {
    if (typeof onSelect === 'function') {
      onSelect(muscle);
    }
  };

  return (
    <svg
      viewBox="0 0 300 400"
      xmlns="http://www.w3.org/2000/svg"
      className="muscle-map-svg"
    >
      {/* Partie frontale simplifiée — exemples interactifs */}
      {/* Abdominaux */}
      <rect
        x="130"
        y="100"
        width="40"
        height="60"
        className="muscle abs"
        onClick={() => handleClick('abs')}
      />
      {/* Quadriceps gauche */}
      <rect
        x="115"
        y="170"
        width="20"
        height="60"
        className="muscle quads-left"
        onClick={() => handleClick('quads-left')}
      />
      {/* Quadriceps droit */}
      <rect
        x="165"
        y="170"
        width="20"
        height="60"
        className="muscle quads-right"
        onClick={() => handleClick('quads-right')}
      />
      {/* Pectoraux */}
      <rect
        x="120"
        y="60"
        width="60"
        height="30"
        className="muscle pecs"
        onClick={() => handleClick('pecs')}
      />
      {/* Biceps gauche */}
      <circle
        cx="100"
        cy="90"
        r="10"
        className="muscle biceps-left"
        onClick={() => handleClick('biceps-left')}
      />
      {/* Biceps droit */}
      <circle
        cx="200"
        cy="90"
        r="10"
        className="muscle biceps-right"
        onClick={() => handleClick('biceps-right')}
      />
      {/* Fessiers */}
      <rect
        x="130"
        y="240"
        width="40"
        height="30"
        className="muscle glutes"
        onClick={() => handleClick('glutes')}
      />
    </svg>
  );
};

export default MuscleMapFull;
